import React from 'react';

function Resume() {
	return (
		<div
			className="d-flex flex-column justify-content-center align-items-center"
			style={{ background: 'black', height: '300px' }}
		>
			<p style={{ color: 'white', fontSize: '2em' }}> بیشتر درباره من</p>
			<button
				style={{
					background: 'black',
					color: 'white',
					padding: '.4em 1.3em',
					border: '2px solid white',
					outline: 'none',
					fontSize: '1.5em'
				}}
			>
				دانلود رزومه
			</button>
		</div>
	);
}

export default Resume;
